import React, { useState, useEffect } from "react";
import axios from "axios";
import Table1 from "../components/cctv1";
import Table2 from "../components/cctv2";
import Table3 from "../components/cctv3";

const App = () => {
  const [apiData1, setApiData1] = useState(null);
  const [apiData2, setApiData2] = useState(null);
  const [totalCCTV, setTotalCCTV] = useState(0);
  const [totalOnlineCCTV, setTotalOnlineCCTV] = useState(0);
  const [totalOfflineCCTV, setTotalOfflineCCTV] = useState(0);

  // Fetch API data
  useEffect(() => {
    const fetchData1 = async () => {
      try {
        const response = await axios.get(
          process.env.REACT_APP_HOST + "/api/ping/check-cctv"
        );
        setApiData1(response.data);
      } catch (error) {
        console.error("Error fetching data from API 1:", error);
      }
    };

    const fetchData2 = async () => {
      try {
        const response = await axios.get(
          process.env.REACT_APP_HOST + "/api/ping/check-cctv2"
        );
        setApiData2(response.data);
      } catch (error) {
        console.error("Error fetching data from API 2:", error);
      }
    };

    fetchData1();
    fetchData2();

    const intervalId = setInterval(() => {
      fetchData1();
      fetchData2();
    }, 2000);

    return () => clearInterval(intervalId);
  }, []);

  // Calculate totals when API data updates
  useEffect(() => {
    if (apiData1 && apiData1.data) {
      let totalIPCount = 0;
      let totalOnline = 0;
      let totalOffline = 0;

      apiData1.data.forEach(room => {
        if (room.roomname !== "HBM") {
          totalIPCount += room.status.length;
          room.status.forEach(camera => {
            if (camera.camera === "ON") {
              totalOnline++;
            } else if (camera.camera === "OFF") {
              totalOffline++;
            }
          });
        }
      });

      setTotalCCTV(total => total + totalIPCount);
      setTotalOnlineCCTV(total => total + totalOnline);
      setTotalOfflineCCTV(total => total + totalOffline);
    }
  }, [apiData1]);

  useEffect(() => {
    if (apiData2 && apiData2.results && apiData2.results.data) {
      let totalIPCount = 0;
      let totalOnline = 0;
      let totalOffline = 0;

      Object.values(apiData2.results.data).forEach(phase => {
        phase.forEach(room => {
          totalIPCount++;
          if (room.status === "ON") {
            totalOnline++;
          } else {
            totalOffline++;
          }
        });
      });

      setTotalCCTV(total => total + totalIPCount);
      setTotalOnlineCCTV(total => total + totalOnline);
      setTotalOfflineCCTV(total => total + totalOffline);
    }
  }, [apiData2]);

  function YourComponent() {
    const currentDate = new Date();
    const options = { day: "2-digit", month: "2-digit", year: "numeric" };
    const formattedDate = currentDate.toLocaleDateString("th-TH", options);
    const timeOptions = { hour: "2-digit", minute: "2-digit" };
    const formattedTime = currentDate.toLocaleTimeString("th-TH", timeOptions);

    return (
      <div>
        <h1>{formattedDate}</h1>
        <h2>{formattedTime}</h2>
      </div>
    );
  }

  return (
    <div className="table-container">
      <div className="img-container">
        <img src={require("../assets/jastel.jpg")} alt="Jastel Logo" />
      </div>
      <h2 className="date">
        <YourComponent />
      </h2>
      <h1 className="title1">Jastel CCTV Monitor</h1>
      <h2 className="title2">Total CCTV: {totalCCTV}</h2>
      <h2 className="title3">Online CCTV: {totalOnlineCCTV}</h2>
      <h2 className="title4">Offline CCTV: {totalOfflineCCTV}</h2>
      <h2 className="title5">Node center : 69</h2>
      <br></br>
      <br></br>
      <br></br>
      <br></br>

      <Table1 apiData={apiData1} />
      <Table2 apiData={apiData1} />
      <Table3 apiData2={apiData2} />
    </div>
  );
};

export default App;
